import './App.css';
import Films from "./components/Movie/Films";
import NavBar from "./components/NavBar/NavBar";

import {BrowserRouter, Switch,Route} from "react-router-dom";
import FilmsPage from "./components/Movie/FilmsPage";

function App() {
    return (

        <BrowserRouter>
            <Switch>
            </Switch>
            <NavBar/>
            <Route path='/'>
                <Films/>
            </Route>

            <Route path='/movies'>
                <FilmsPage/>
            </Route>
        </BrowserRouter>


    );
}

export default App;
